"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[593],{5593:function(e){e.exports=JSON.parse('{"projects":[{"id":"three-body-slingshots","slug":"three-body-gravitational-slingshots","title":"Three-Body Gravitational Slingshot Dynamics","shortDescription":"Numerical investigation of energy amplification and orbital scattering in three-body gravitational slingshots around stars and planets.","fullDescription":"This project explores gravitational slingshot dynamics beyond the classical two-body approximation by modeling hyperbolic flybys in full three-body systems. I developed a custom symplectic N-body integrator and a batch-injection pipeline to simulate thousands of encounters across star–planet configurations, including close-in hot Jupiter systems.\\n\\nInitial parameter sweeps are used to filter unsuccessful trajectories, followed by MCMC refinement to converge on high-deflection, high-energy-transfer encounters. The simulations reveal a narrow but robust window in which orbital angular momentum from a third body can be harnessed to produce velocity gains far exceeding matched two-body flybys. In some configurations, the resulting barycentric ∆v surpasses traditional planetary assists by orders of magnitude.\\n\\nThis work reframes optimization in chaotic systems as instance-finding rather than global maximization, and demonstrates how multi-body dynamical focusing can act as a natural gravitational engine. Results are validated through analytic–numerical comparisons and ongoing robustness testing.","tags":["astrophysics","orbital-dynamics","numerical-simulation","chaos","research"],"heroImage":"/projects/three-body-gravitational-slingshots/three_body_energy_ceiling.png","gallery":["/projects/three-body-gravitational-slingshots/three_body_energy_ceiling.png"],"videoDemo":"/projects/three-body-gravitational-slingshots/trajectory_scatter_plot.mp4","technologies":["Python","Symplectic N-body Integrator","NumPy","SciPy","Matplotlib","MCMC (emcee)","Monte Carlo Sampling","Orbital Mechanics"],"links":{"github":"","paper":""},"dates":{"start":"2024-09","end":"2026-02"},"featured":true,"order":1,"sections":[{"title":"The Challenge","insight":"Two-body gravity assists plateau at 2√2 of the hyperbolic excess velocity","description":"Traditional planetary gravitational assists are limited by the topology of the hyperbolic trajectory. No matter how perfectly aligned, a two-body encounter can only deflect a craft by a finite maximum angle. When the third massive body enters the interaction, the phase-space topology becomes chaotic—and new pathways emerge.","media":"/projects/three-body-gravitational-slingshots/phase_space_diagram.png","layout":"image-right"},{"title":"The Approach","insight":"Custom symplectic integrator + batch MCMC parameter refinement","description":"I built a high-order symplectic N-body solver to model thousands of hyperbolic encounters without introducing artificial dissipation. Rather than optimize globally (which fails in chaos), I batch-inject initial conditions across large parameter grids, filter for interesting dynamical outcomes, then use Markov-chain refinement to converge on rare, high-gain configurations. This transforms a hard optimization problem into instance-finding in a chaotic attractor.","media":"/projects/three-body-gravitational-slingshots/parameter_sweep_grid.png","layout":"image-left"},{"title":"Key Results","insight":"Velocity amplification 3–15\xd7 greater than two-body baseline","description":"In certain star–planet geometries, the three-body scattering produces hyperbolic excess velocities that exceed matched two-body flybys by orders of magnitude. The mechanism: the third body shifts the reference frame dynamically, allowing the probe to harvest orbital energy from the wider binary. Analytic comparisons with restricted three-body theory validate the numerical results.","media":"/projects/three-body-gravitational-slingshots/energy_gain_histogram.png","layout":"image-right"}]},{"id":"regen-liquid-rocket","slug":"regenerative-liquid-rocket-engine","title":"Regeneratively Cooled Bi-Liquid Rocket Engine","shortDescription":"Design and fabrication of a low-resource, regeneratively cooled bi-liquid rocket engine under real manufacturing constraints.","fullDescription":"This project focuses on the end-to-end development of a regeneratively cooled bi-liquid rocket engine, designed and built under limited tooling and resource constraints. Without access to conventional CNC or additive manufacturing, the engine chamber and nozzle were fabricated from laser-cut, formed, and TIG-welded stainless steel sheet.\\n\\nI developed a custom 1D thermal model to simulate transient heat transfer along the chamber wall, coupling convective heating from combustion gases with conductive and convective heat removal by ethanol coolant channels. This model informed channel sizing, wall thickness, and allowable duty cycles near material yield limits.\\n\\nKey design decisions intentionally sacrificed peak performance in favor of survivability and manufacturability, including reduced feed pressures to maintain injector stability and thermal margins. The project emphasizes hardware-first iteration grounded in first-principles analysis, bridging propulsion theory with fabrication reality.","tags":["rocket-propulsion","heat-transfer","fabrication","systems-engineering","hardware"],"heroImage":"/projects/regenerative-liquid-rocket-engine/regen_chamber_welded.jpg","gallery":["/projects/regenerative-liquid-rocket-engine/regen_chamber_welded.jpg","/projects/regenerative-liquid-rocket-engine/thermal_profile_plot.png"],"technologies":["Python","RPA (Rocket Propulsion Analysis)","TIG Welding","Sheet Metal Fabrication","Fusion 360","SolidWorks","P&ID Development","Instrumentation"],"links":{"github":"","documentation":""},"dates":{"start":"2025-06","end":"2026-02"},"featured":true,"order":2,"sections":[{"title":"Design Constraints","insight":"Sheet metal + TIG weld, no CNC access—reframe for manufacturability","description":"Rather than design optimally then search for a machine, the project inverted the workflow: design for what we can actually build. This meant embracing sheet-metal and manual welding, laser cutting for precision, and intentionally forgiving tolerances on interfaces. The chamber comprises laser-cut barrel sections and formed domes, assembled and TIG-welded by hand. No 5-axis milling. No additive manufacturing.","media":"/projects/regenerative-liquid-rocket-engine/fabrication_steps.png","layout":"image-right"},{"title":"Thermal Modeling","insight":"1D transient heat conduction coupling combustion gases to coolant channels","description":"Heat transfer in the chamber occurs across three layers: (1) hypersonic combustion gas boundary layer, (2) stainless steel wall with anisotropic conduction, (3) turbulent ethanol coolant in spiral channels. I solved the coupled PDE using finite-difference discretization with material-dependent thermal properties and temperature-dependent viscosity. The model predicts hot-side wall temperature and coolant outlet state, constraining channel spacing and wall thickness.","media":"/projects/regenerative-liquid-rocket-engine/thermal_profile_slice.png","caption":"Radial temperature profile at chamber midplane during steady-state operation","layout":"image-left"},{"title":"Test & Validation","insight":"Hot-fire data correlates within 8% of thermal model predictions","description":"Static testing on a vertical thrust stand with embedded thermocouples and real-time DAQ validated the thermal predictions. Chamber pressure, thrust, chamber temperature, and coolant temperature were logged at 100 Hz. Post-test analysis showed the steady-state chamber wall temperature agreed with the numerical model within measurement uncertainty, validating the approach and informing duty-cycle margins for flight.","media":"/projects/regenerative-liquid-rocket-engine/hotfire_temperature_trace.png","caption":"Temperature traces from static fire test (thermocouples embedded in chamber wall)","layout":"image-right"}]},{"id":"machining-fundamentals","slug":"advanced-machining-fundamentals","title":"Fundamentals of Advanced Machining (Teaching Series)","shortDescription":"A physics-first approach to CNC machining, replacing folklore with power, torque, and material reasoning.","fullDescription":"This teaching project was developed to address a recurring gap in machining education: students could follow feeds-and-speeds tables but lacked a generalized understanding of why machines behave the way they do. I designed and delivered a multi-part lecture series that reframes machining from first principles, starting with material hardness (BHN), unit power, spindle torque, and duty cycles.\\n\\nRather than optimizing for specific tools or machines, the framework emphasizes transferable reasoning applicable across different CNC platforms and materials. Topics include spindle power curves, thermal limits, tool engagement dynamics, chip thinning, and the tradeoffs between high-speed and high-efficiency machining.\\n\\nThe series enabled students to push machines confidently and safely, replacing fear-driven conservatism with informed judgment. The curriculum has since influenced shop SOPs and advanced workshop offerings.","tags":["manufacturing","cnc-machining","teaching","first-principles","cam"],"heroImage":"/projects/advanced-machining-fundamentals/spindle_torque_chart.png","gallery":["/projects/advanced-machining-fundamentals/spindle_torque_chart.png"],"videoDemo":"/projects/advanced-machining-fundamentals/adaptive_toolpath_demo.mp4","technologies":["Fusion 360 CAM","CNC Milling (Fadal, Tormach)","Machining Theory","Power Modeling","CAD/CAM Post-processing"],"links":{"slides":"","videos":""},"dates":{"start":"2025-04","end":"2025-05"},"featured":true,"order":3},{"id":"csi-hybrid-rocket","slug":"columbia-hybrid-rocket","title":"Columbia Space Initiative Hybrid Rocket Program","shortDescription":"Propulsion and structural leadership for Columbia\'s first large-scale hybrid rocket, culminating in a successful full-scale flight.","fullDescription":"As Rocket Project Lead and Propulsion Lead for the Columbia Space Initiative, I helped lead the end-to-end development of the university\'s first 6-inch, 115 lb hybrid rocket. The project required coordinating propulsion, structures, avionics, recovery, and test operations across a 50+ member undergraduate team while establishing a culture of documentation, safety, and repeatability.\\n\\nOn the propulsion side, I led the design and validation of nitrous–paraffin hybrid engines, performing transient thermal modeling, injector mass-flow analysis, and high-temperature FEA on nozzles and combustion interfaces. These models were validated through static hot-fire testing and thrust-curve correlation using a custom Python data-reduction pipeline.\\n\\nStructurally, I directed the transition from a legacy 4.5\\" airframe to a modular 6.0\\" composite architecture, enabling higher chamber pressures, improved load paths, and more robust avionics integration. The project culminated in a successful flight at the Spaceport America Cup, marking a milestone for Columbia\'s undergraduate rocketry program.","tags":["rocketry","propulsion","systems-engineering","leadership","flight-hardware"],"heroImage":"/projects/columbia-hybrid-rocket/csi_hybrid_launch.jpg","gallery":["/projects/columbia-hybrid-rocket/csi_hybrid_launch.jpg","/projects/columbia-hybrid-rocket/hotfire_thrust_curve.png"],"technologies":["Hybrid Rocket Propulsion","Python","FEA","Thermal Analysis","Composite Structures","Instrumentation","DAQ","Systems Integration"],"links":{"teamsite":"","datarepo":""},"dates":{"start":"2019-09","end":"2023-06"},"featured":true,"order":4},{"id":"farout-propulsion","slug":"farout-propulsion-mentorship","title":"FAROUT Hybrid & Liquid Propulsion Mentor","shortDescription":"Propulsion safety, systems review, and technical mentorship for collegiate hybrid and liquid rocket teams.","fullDescription":"I serve as a hybrid and liquid propulsion safety and technical mentor for FAROUT (Friends of Amateur Rocketry: Oxidizers Uninhibited Tournament), a collegiate rocketry competition focused on advanced propulsion systems. My role involves reviewing propulsion hardware, feed systems, test procedures, and flight-readiness documentation for multiple teams across different institutions.\\n\\nBeyond formal reviews, I support teams through design iteration, failure analysis, and go/no-go decision-making during static fires and launch operations. This includes assessing single-fault risks, thermal and pressure margins, and operational readiness under real-time constraints.\\n\\nFor FAROUT 2025, I successfully oversaw multiple teams through safe static-fire and launch operations. For FAROUT 2026, I was appointed as an official team mentor for Columbia Rocketry and several international teams, providing ongoing guidance throughout their development cycles.","tags":["rocketry","safety-engineering","mentorship","operations","leadership"],"heroImage":"/projects/farout-propulsion-mentorship/farout_launch_ops.jpg","gallery":["/projects/farout-propulsion-mentorship/farout_launch_ops.jpg","/projects/farout-propulsion-mentorship/static_fire_pad.jpg"],"technologies":["Hybrid Propulsion","Liquid Propulsion","Safety Analysis","Fault Assessment","Test Operations","Pressure-Fed Systems","Technical Documentation"],"links":{"competition":""},"dates":{"start":"2024-01","end":"2026-02"},"featured":true,"order":5},{"id":"cnc-lab-modernization","slug":"cnc-lab-modernization","title":"CNC Lab Modernization & CAM Enablement","shortDescription":"Modernization of legacy CNC infrastructure to enable high-precision, CAM-driven manufacturing at scale.","fullDescription":"As Lead Machinist and CNC Programmer in the Columbia Mechanical Engineering Teaching Lab, I was responsible for maintaining, restoring, and upgrading over ten CNC and manual machines used daily by hundreds of students. This included recommissioning a legacy Fadal VMC15, retrofitting Tormach mills with probing, tool-offset systems, and coolant upgrades, and restoring machines that had been out of service due to wear or control limitations.\\n\\nOne of the most impactful contributions was the development of a custom Anilam post-processor, enabling modern CAM toolpaths on older Fryer CNC mills that previously lacked full G-code compatibility. This effectively expanded the lab\'s CAM-capable machining capacity without purchasing new equipment.\\n\\nI also designed custom fixtures, machined tight-tolerance components, digitized tool inventories, and authored SOPs that significantly reduced downtime while improving safety and throughput during peak academic periods.","tags":["manufacturing","cnc","infrastructure","tooling","education"],"heroImage":"/projects/cnc-lab-modernization/fadal_vmc_restore.jpg","gallery":["/projects/cnc-lab-modernization/fadal_vmc_restore.jpg","/projects/cnc-lab-modernization/cnc_fixture_setup.jpg"],"technologies":["CNC Milling","CNC Turning","Fusion 360 CAM","Custom Post-processors","Machine Maintenance","Retrofits","GD&T","Metrology"],"links":{"postprocessor":""},"dates":{"start":"2023-08","end":"2025-06"},"featured":false,"order":6},{"id":"home-lab-networking","slug":"home-lab-networking","title":"Segmented Home–Lab Network Infrastructure","shortDescription":"Design and deployment of a secure, segmented network for experimental hardware, IoT devices, and remote access.","fullDescription":"This project involved designing and maintaining a segmented home and lab network to support experimental hardware, student devices, cameras, and remote access without compromising reliability or security. The network is structured around multiple VLANs isolating IoT devices, guest traffic, cameras, and experimental systems, with zone-based firewall rules enforcing strict access boundaries.\\n\\nA dedicated 2.4 GHz student VLAN with static IP allocation supports embedded devices and microcontrollers, while a site-to-site VPN enables secure remote access for monitoring and maintenance. UniFi Protect is used for video security, and ongoing firmware management ensures long-term stability.\\n\\nThe project reflects a systems-engineering mindset applied to infrastructure: anticipating failure modes, isolating risk, and designing for observability rather than convenience.","tags":["networking","infrastructure","systems-engineering","security","homelab"],"heroImage":"/projects/home-lab-networking/network_topology.png","gallery":["/projects/home-lab-networking/network_topology.png","/projects/home-lab-networking/unifi_dashboard.png"],"technologies":["UniFi OS","VLAN Design","Firewall Configuration","Site-to-Site VPN","Network Security","Embedded Systems Support","UniFi Protect"],"links":{"diagram":""},"dates":{"start":"2023-01","end":"2026-02"},"featured":false,"order":7},{"id":"cool-worlds-outreach","slug":"cool-worlds-science-communication","title":"Cool Worlds Astrophysics Media & Outreach","shortDescription":"Long-form astrophysics storytelling and educational outreach for a global audience of millions.","fullDescription":"As a video editor and content producer for the Cool Worlds YouTube channel, I collaborate with professional astrophysicists to translate active research topics into accessible, visually compelling narratives. Over the past several years, I have edited and produced 30+ long-form videos and projects reaching over 10 million cumulative views worldwide.\\n\\nMy role goes beyond post-production. I actively participate in storyboarding, visual sequencing, and narrative pacing to ensure complex concepts—such as gravitational lensing, exoplanet detection methods, and cosmological modeling—are communicated accurately without overwhelming non-technical audiences. This requires deliberate choices about what technical detail to omit, what metaphors to introduce, and where precision must be preserved.\\n\\nThis work has fundamentally shaped how I design technical systems and research pipelines: documentation, clarity of intent, and the ability to explain why something works are treated as core engineering requirements rather than afterthoughts.","tags":["science-communication","astrophysics","outreach","education","media"],"heroImage":"/projects/cool-worlds-science-communication/cool_worlds_timeline.png","gallery":["/projects/cool-worlds-science-communication/cool_worlds_timeline.png"],"videoDemo":"/projects/cool-worlds-science-communication/cool_worlds_motion_graphics.mp4","technologies":["Adobe Premiere Pro","After Effects","Motion Graphics","Compositing","Science Storytelling","Technical Visualization"],"links":{"channel":"https://www.youtube.com/@CoolWorldsLab"},"dates":{"start":"2022-01","end":"2026-02"},"featured":false,"order":8},{"id":"asteroid-orbit","slug":"asteroid-orbit-determination","title":"Near-Earth Asteroid Orbit Determination","shortDescription":"Astrometric and photometric orbit determination of a near-Earth asteroid using classical celestial mechanics.","fullDescription":"During the Summer Science Program in Astrophysics, I led a three-person research team focused on the observation and orbit determination of the near-Earth asteroid 1991 PM5. Over multiple nights of observation, we collected astrometric and photometric data using a 0.36 m Schmidt–Cassegrain telescope and CCD imaging system.\\n\\nI developed custom Python pipelines for centroiding, plate reduction, and differential photometry, achieving arcsecond-level astrometric precision. Using a fourth-order implementation of the Method of Gauss with light-time correction, I computed heliocentric orbital elements and refined them through differential correction and Monte Carlo uncertainty analysis.\\n\\nThe final orbital solution was validated against JPL Horizons and submitted to the Minor Planet Center, where it was published and archived. This project marked my first exposure to real scientific uncertainty, numerical instability, and the rigor required for publishable astronomical results.","tags":["astrophysics","observational-astronomy","numerical-methods","research","early-work"],"heroImage":"/projects/asteroid-orbit-determination/asteroid_astrometry_plot.png","gallery":["/projects/asteroid-orbit-determination/asteroid_astrometry_plot.png","/projects/asteroid-orbit-determination/orbital_elements_diagram.png"],"technologies":["Python","Astrometry","Photometry","Classical Orbital Mechanics","Monte Carlo Analysis","Telescope Instrumentation"],"links":{"mpc":""},"dates":{"start":"2018-06","end":"2018-07"},"featured":false,"order":9},{"id":"astrostatistics","slug":"astrostatistics-bayesian-modeling","title":"Astrostatistics & Bayesian Inference Projects","shortDescription":"A collection of Bayesian inference and statistical modeling projects applied to astrophysical data.","fullDescription":"This project collection includes multiple astrostatistics studies conducted during advanced coursework and independent research, focused on extracting physical insight from noisy or incomplete data. Projects include Bayesian estimation of the Hubble constant from Type Ia supernovae, MCMC-based exoplanet transit fitting, stellar temperature inference using black-body models, and model selection for galaxy rotation curves under dark matter and modified gravity hypotheses.\\n\\nAcross these studies, I developed custom MCMC samplers, implemented likelihood functions from first principles, and applied rigorous model comparison techniques including BIC, AIC, and χ\xb2 analysis. Emphasis was placed on diagnosing sampler behavior, convergence, and degeneracies rather than treating statistical tools as black boxes.\\n\\nThis work laid the computational and statistical foundation for my later research in chaotic three-body dynamics and parameter-space exploration.","tags":["astrostatistics","bayesian-methods","data-analysis","modeling","research"],"heroImage":"/projects/astrostatistics-bayesian-modeling/mcmc_corner_plot.png","gallery":["/projects/astrostatistics-bayesian-modeling/mcmc_corner_plot.png","/projects/astrostatistics-bayesian-modeling/rotation_curve_fit.png"],"technologies":["Python","emcee","NumPy","SciPy","Pandas","Bayesian Inference","Statistical Diagnostics"],"links":{"notebooks":""},"dates":{"start":"2023-01","end":"2023-06"},"featured":false,"order":10}]}')}}]);